#back-top {
  position: fixed;
  right: 0;
  bottom: 30px;
  cursor: pointer;
  z-index: 9999999;
  opacity: 0;
  -webkit-transition: all 0.3s ease 0s;
  -moz-transition: all 0.3s ease 0s;
  -o-transition: all 0.3s ease 0s;
  transition: all 0.3s ease 0s;
}

#back-top a {
  background: #1B5E20;
  display: block;
  text-align: center;
  width: 35px;
  height: 40px;
  border-radius: 5px 5px 0 0;
  padding: 12px 8px 8px 7px;
  -webkit-transition: all 0.3s ease 0s;
  -moz-transition: all 0.3s ease 0s;
  -o-transition: all 0.3s ease 0s;
  transition: all 0.3s ease 0s;
}

